function GoogleGeocode(){var a=new google.maps.Geocoder;this.geocode=function(b,c){a.geocode({address:b},function(a,b){if(b===google.maps.GeocoderStatus.OK){var d={};d.latitude=a[0].geometry.location.lat(),d.longitude=a[0].geometry.location.lng(),c(d)}else alert("Geocode was not successful for the following reason: "+b),c(null)})}}$(function(){$("#user-location").on("submit",function(a){a.preventDefault();var b=$("form #address").val();""===b&&alert("The input box was blank.");var c=new GoogleGeocode,d=b;c.geocode(d,function(a){null!=a?(olat=a.latitude,olng=a.longitude,$("#geocode-result").append("Latitude: "+olat+"<br />Longitude: "+olng+"<br /><br />")):alert("ERROR! Unable to geocode address")})})});